dbQuery.query:
WITH zones AS (SELECT zone_id FROM web50.m_25_zone_to_srv_district WHERE SRV_DISTRICT_ID IN ({LPU_ACCESS_FILTER}) )
SELECT * FROM ( SELECT ROW_NUMBER() OVER (ORDER BY {ORDER_COLUMNS} ) RWN, all_in_one.ID, all_in_one.OBJ_CLS_ID ,all_in_one.DESCR,all_in_one.C1,all_in_one.C2,all_in_one.C3,all_in_one.C4 ,all_in_one.C7,all_in_one.C9,all_in_one.C10,all_in_one.C11,all_in_one.C12 ,all_in_one.C25,all_in_one.C26,all_in_one.C28,all_in_one.C30,all_in_one.C32 ,all_in_one.C33,all_in_one.C34,all_in_one.C35,all_in_one.C46,all_in_one.C55 ,all_in_one.C220,all_in_one.C221,all_in_one.C222,all_in_one.C234,all_in_one.C236
FROM (SELECT m.* FROM WEB50.M_25_GIDR_LP m WHERE m.zone_id IN (SELECT zone_id FROM zones)) all_in_one WHERE {FILTER}) sorted WHERE RWN BETWEEN {LOW_LIMIT} AND {HIGH_LIMIT}

